import React from "react";
import './Monitor.css';

function Monitor(prop) {
  if (!prop.monitor) {
    return null; // Return null if prop.monitor is undefined or empty
  }

  return (
    <div className="MonitorWrapper">
      {prop.monitor.map((ele) => (
        <div className="boxzz" key={ele.id}></div>
      ))}
    </div>
  );
}

export default Monitor;
